import React, { FunctionComponent, useState, useEffect } from 'react';
import Pokemon from './models/pokemon';
import POKEMON from './models/mock-pokemon';

const App: FunctionComponent = () => {
  const [pokemons, setPokemons] = useState<Pokemon[]>([]);

  useEffect(() => {
    setPokemons(POKEMON);
  }, []);

  const showPokemonName = () => {
    console.log(pokemons[1].name);
  };

  return (
    <div>
      <h1>Voici la liste des Pokemons</h1>
      <ul>{pokemons.map(({ id, name, picture }) => (
        <li key={id}><img src={picture} /><strong>{name}</strong></li>
      ))
      }
      </ul>
    </div>
  )
}

export default App;
